angular.module("Comparonics",["ngResource","ngRoute"]);function config(t,r){t.when("/",{templateUrl:"partials/index.html",controller:"homeCtrl",controllerAs:"vm"}).when("/items",{templateUrl:"partials/allItems.html",controller:"itemsCtrl",controllerAs:"vm"}).when("/:itemid",{templateUrl:"partials/item.html",controller:"productCtrl",controllerAs:"vm"}).otherwise({redirectTo:"/"});r.html5Mode({enabled:true,requireBase:false})}angular.module("Comparonics").config(["$routeProvider","$locationProvider",config]);angular.module("Comparonics").controller("homeCtrl",homeCtrl);function homeCtrl(){var t=this;t.pageHeader={title:"Comparonics"}}angular.module("Comparonics").service("comparonicsData",comparonicsData);comparonicsData.$inject=["$http"];function comparonicsData(t){var r=function(r){return t.get("/api/items/"+r)};return{itemById:r}}angular.module("Comparonics").controller("itemsCtrl",itemsCtrl);itemsCtrl.$inject=["$http"];function itemsCtrl(t){var r=this;t.get("/products").then(function(t){r.data=t})}angular.module("Comparonics").controller("productCtrl",productCtrl);productCtrl.$inject=["$routeParams","comparonicsData"];function productCtrl(t,r){var e=this;e.itemid=t.itemid;r.itemById(e.itemid).success(function(t){e.data={item:t};e.pageHeader={title:e.data.item.model}}).error(function(t){console.log(t)})}